import React, { Component } from "react";

class NrWomen extends Component {
  render() {
    const { thirdbox, index } = this.props;
    return (
      <li className="nrWomenItem">
        {/* <a className="nrWomenLink" href> */}
        <a className={index === 0 ? "nrWomenLinkMain" : "nrWomenLink"} href>
          {thirdbox}
        </a>
      </li>
    );
  }
}

export default NrWomen;
